/**
* Gets General Course data from legit Peoplesoft Tables
* @company CCC Tech Center
* @version CAv4.5.0
*/
class CCTC_Course
   method CCTC_Course();

   method getCourse(&bindVars As array of any) Returns array of array of any;

   method getCourseFees(&bindVars As array of any) Returns array of array of any;

   method getCourseComponents(&bindVars As array of any) Returns array of array of any;

   method getCourseRequisites(&bindVars As array of any) Returns array of array of any;
end-class;

method CCTC_Course
   rem do nothing;
end-method;


/**
* This function provides an interface to the College Adaptor to 
* retrieve the Course details for a given course and term
* 
* @param &bindVars[1]: sisCourseId: SUBJ-NBR
* @param &bindVars[2]: sisTermId: STRM
* @param &bindVars[3]: Institution
* @param &bindVars[4]: Acad Career
* @param &bindVars[5]: Course Attribute Code for Transfer Status flag
* @param &bindVars[6]: Course Attribute Code for Credit Status flag
* @Returns 2d array with a single row representing the matched course 
*/
method getCourse
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   rem validate parameters/arguments;
   If &bindVars.Len <> 6 Then
      Error "bindVars should have 6 elements when getting student course data";
   End-If;

   If None(&bindVars [1]) Then
      Error "sisCourseId (SUBJ-NBR) is required";
   End-If;

   If None(&bindVars [2]) Then
      Error "sisTermId is required";
   End-If;

   If None(&bindVars [3]) Then
      Error "institution is required";
   End-If;

   If None(&bindVars [4]) Then
      Error "acad_career is required";
   End-If;

   If None(&bindVars [5]) Then
      Error "course attribute for transfer status info is required";
   End-If;

   If None(&bindVars [6]) Then
      Error "course attribute for credit status info is required";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_CRSE_DTL_GET, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      Local number &i = 0;
      Local number &maxRows = 1;
      While &sql.Fetch(&AAny) And
            &i < &maxRows
         Local number &j = 0;
         Local array of any &temp = CreateArrayAny();
         For &j = 1 To &AAny.Len
            &temp.Push(&AAny [&j]);
         End-For;
         &result_list.Push(&temp);
         &i = &i + 1;
      End-While;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

