* @param &bindVars[3]: Acad Career
* @param &bindVars[4]: sisCourseId: (SUBJ-NBR)
* @Returns 2d array with a row per the matched section 
*/
method getSectionsForCourse
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   rem validate parameters/arguments;
   If &bindVars.Len <> 4 Then
      Error "bindVars should have 4 elements when getting all the sections for a course";
