         &i = &i + 1;
      End-While;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

/**
* This function provides an interface to the College Adaptor to 
* serach for section details by term and a list of search words
* 
* @param &bindVars[1]: sisTermId: STRM
* @param &bindVars[2]: Institution
* @param &bindVars[3]: Acad Career
* @param &bindVars[4]: Search Word 1
* @param &bindVars[5]: Search Word 2
* @param &bindVars[6]: Search Word 3
* ....
* @param &bindVars[N]: Search Word (N-3)
* @Returns 2d array with a row per each matched section 
*/
method searchForSections
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   rem validate parameters/arguments;
   If &bindVars.Len < 4 Then
      Error "bindVars should have at least 4 elements when searching for sections";
   End-If;

   If None(&bindVars [1]) Then
      Error "sisTermId is required";
   End-If;

   If None(&bindVars [2]) Then
      Error "institution is required";
   End-If;

   If None(&bindVars [3]) Then
      Error "acad_career is required";
   End-If;

   If None(&bindVars [4]) Then
      Error "at least one search word is required";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local string &sqlstmt = FetchSQL(SQL.CCTC_SCTN_SRCH_GET);

   Local number &b = 4;
   While &b <= &bindVars.Len And
         All(&bindVars [&b])
      &sqlstmt = &sqlstmt | " AND (";
      &sqlstmt = &sqlstmt | " upper(:" | &b | ") in (";
      &sqlstmt = &sqlstmt | " upper(trim(A.SUBJECT)), upper(trim(A.CATALOG_NBR)), upper(trim(A.SUBJECT) || '-' || trim(A.CATALOG_NBR)), upper(trim(A.CLASS_NBR)), ";
      &sqlstmt = &sqlstmt | " upper(trim(N.LAST_NAME)), upper(trim(N.FIRST_NAME)), upper(trim(N.EMPLID)), ";
      &sqlstmt = &sqlstmt | " upper(trim(F.BLDG_CD)), upper(trim(F.ROOM)), upper(trim(F.LOCATION)) ";
      &sqlstmt = &sqlstmt | " ) ";
      &sqlstmt = &sqlstmt | " or instr(upper(A.DESCR), upper(:" | &b | ")) > 0 ";
      &sqlstmt = &sqlstmt | " )";
      &b = &b + 1;
   End-While;
   Local SQL &sql = CreateSQL(&sqlstmt, &bindVars);

   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      Local array of any &sectionBindVars = CreateArrayAny();
      &sectionBindVars [1] = &bindVars [1];
      &sectionBindVars [2] = &bindVars [2];
      &sectionBindVars [3] = &bindVars [3];
      Local string &inList = "";
      Local number &i = 0;
      Local number &maxRows = 500;
      While &sql.Fetch(&AAny) And
            &i < &maxRows
         Local string &class_nbr = &AAny [1];
         &sectionBindVars [&i + 4] = &class_nbr;
         &inList = &inList | ", :" | (&i + 4);
         &i = &i + 1;
      End-While;
      &sql.Close();

      If &sectionBindVars.Len > 3 Then
         &sqlstmt = FetchSQL(SQL.CCTC_SCTN_LIST_GET);
         &sqlstmt = &sqlstmt | " AND A.CLASS_NBR IN ('00' " | &inList | " )";

         &sql = CreateSQL(&sqlstmt, &sectionBindVars);
         If &sql.Status <> %SQLStatus_OK Then
            Error String(&sql.Status);
         Else
            &i = 0;
            &maxRows = 500;
            While &sql.Fetch(&AAny) And
                  &i < &maxRows
               Local number &j = 0;
               Local array of any &temp = CreateArrayAny();
               For &j = 1 To &AAny.Len
                  &temp.Push(&AAny [&j]);
               End-For;
               &result_list.Push(&temp);
               &i = &i + 1;
            End-While;
         End-If;
      End-If;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

